import React from 'react';


const Card = props => {
    const {charac} = props;
    return (
        <div className="card">
                  <h2 className="name">{charac.name}</h2>
                  <img className="img" src={charac.image} alt={charac.name}/>
                  </div>
    );
};


export default Card;
